import paho.mqtt.subscribe as subscribeimport jsonfrom datetime import datetime# MQTT connection detailsbroker_url = "mqtt.eclipseprojects.io"broker_port = 1883topic = "HAN/#" # "#" indicates that we subscribe to all topics after "HAN/"#list to store datacache = []# Define function to call by callback methoddef on_message(client, userdata, message):    # Parse the message    data = json.loads(message.payload) #append decoded json to data dict    data["timestamp"] = datetime.now()    data["topic"] = message.topic    cache.append(data) #append to cache list        # Print the message for debugging    print(f"Received message: {message.payload.decode('utf-8')}")    print(f"Topic: {message.topic}")# Connect function to mqtt datastreamsubscribe.callback(on_message, topic, hostname=broker_url, port=broker_port)# Print the received data stored in 'cache'print(cache)